import React from "react";
import "./Projects.css";
import db from "./db.json";

const AllProj = () => {
  return (
    <div>
      {db[0].project.map((e) => (
        <div className="row" style={{width:"100vh"}} key={e.sNo}>
          <div className="col-xl-6">
            <img style={{height:"50vh", objectFit:"contain"}} src={e.image} alt={e.sNo} />
          </div>
          <div className="col-xl-6">
            <h3>{e.title}</h3>
            <a href={e.link}>
              <i className="fa-solid fa-link mx-2"></i>
            </a>
            <p>{e.description}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default AllProj;
